contracts/3_Ballot.sol.content:
pragma solidity ^0.4.17;

contract Inbox {
    string public message;
    string public fMessage;

    function Inbox(string initialMessage, string finalMessage) public {
        message = initialMessage;
        fMessage = finalMessage;
    }

    function setMessage(string newMessage) public {
        message = newMessage;
    }

    function getMessage() public view returns (string) {
        return message;
    }

    function getfMessage() public view returns (string) {
        return message;
    }
}

